#!/usr/bin/env python3
"""Recreate new_pdf_cracker.cpp without needing git."""
import base64
import gzip
import pathlib

B64_DATA = """

"""

def main():
    data = gzip.decompress(base64.b64decode(B64_DATA))
    dest = pathlib.Path("new_pdf_cracker.cpp")
    dest.write_bytes(data)
    print(f"Wrote {dest} ({dest.stat().st_size} bytes)")

if __name__ == "__main__":
    main()